import React, {useEffect, useState} from "react";
import './projects.css'

const Projects = () => {

    const [search, setSearch] = useState('')

    const getProjects = async () => {
        const response = await fetch(`/getProjects`)
        const data = await response.json();
        console.log(data)
    }

    useEffect(() => {
        getProjects();
    }, [])

    return(
        <div className="app">
        <div className="project-search">
            <input
            placeholder="Seach project"
            value={search}
            onChange={()=> {}}
            />
            <button>
                SEARCH
            </button>
            <button>
                CREATE
            </button>
        </div>
        <div className="container">
            <div className="project">
                <div>
                    <p>CERRADO</p>
                </div>
                <div>
                    <img src={'https://images.pexels.com/photos/11866150/pexels-photo-11866150.jpeg?cs=srgb&dl=pexels-%D0%BD%D0%B0%D1%82%D0%B0%D1%88%D0%B0-%D1%87%D0%B8%D0%B6%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F-11866150.jpg&fm=jpg'}/>
                </div>
                <div>
                    <span>21/03/2022</span>
                    <h3>Las matas de cartagena</h3>
                    
                </div>
                <div>
                    <h2>Macos Melendez</h2>
                </div>

            </div>
        </div>
        </div>
    )
}

export default Projects;
